function blogListCtrl(a,b,c){a.remove=function(b){c.delete("/blog/archive/"+a.blogs[b].displaytitle).success(function(c,d){204==d&&a.blogs.splice(b,1)})},a.getPosts=function(){c.get("/blog/archive").success(function(c){angular.element(b.document.getElementById("blogs-loading")).remove(),c.list&&(a.blogs=c.list),c.err&&console.log(c.err)})},a.getTags=function(a){return c.get("/blog/archive/tags",{params:{t:a}}).then(function(a){return a.data.err&&console.log(a.data.err),a.data.msg&&console.log(a.data.msg),a.data.list})},a.getPosts()}